// Vars
function getMessage(msgEvent) {
    if (msgEvent.name == "settingValueIs"){
        //
		ajxloader =  msgEvent.message;
		if(ajxloader == "#random#"){
				var array_random = new Array(15);
				array_random[0]="css/indicator.css"; 
				array_random[1]="css/google.css"; 
				array_random[2]="css/circleball.css"; 
				array_random[3]="css/bouncingball.css"; 
				array_random[4]="css/facebook.css"; 
				array_random[5]="css/flower.css"; 			
				array_random[6]="css/kit.css"; 
				array_random[7]="css/roller.css"; 
				array_random[8]="css/snake.css";
				array_random[9]="css/wheel.css";
				array_random[10]="css/3drotation.css";
				array_random[11]="css/arrows.css";
				array_random[12]="css/circleball1.css";
				array_random[13]="css/radar.css";
				array_random[14]="css/static.css"; 		
				var rand_no = Math.random();
				rand_no = Math.floor(rand_no * 14);
				ajxloader = array_random[rand_no];	
			}
			//	
			var cssNode = document.createElement("style");
			var selector = '#viewer-details-toggle.details-loading, #loading-area .message-area-text-container, #loadingStatus, .vZ, .L4XNt,#lo,#sites-notice,#loadmessagehtml';
			var declaration = "";
			if(ajxloader=="css/indicator.css" || typeof(ajxloader) == 'undefined'){
				ajax_image = "data:image/gif;base64,";
				declaration = "background-image:url("+ajax_image+") !important;background-repeat:no-repeat;";
			}else if(ajxloader=="css/google.css"){
					ajax_image = "data:image/gif;base64,";		
				declaration = "background-image:url("+ajax_image+") !important;background-repeat:no-repeat;";
			}else if(ajxloader=="css/circleball.css"){
				ajax_image = "data:image/gif;base64,";
				declaration = "background-image:url("+ajax_image+") !important;background-repeat:no-repeat;background-position:3px 2px;";
			}else if(ajxloader=="css/bouncingball.css"){
				ajax_image = "data:image/gif;base64,";
				declaration = "background-image:url("+ajax_image+") !important;background-repeat:no-repeat;background-position:3px 2px;";
			}else if(ajxloader=="css/facebook.css"){
				ajax_image = "data:image/gif;base64,";
				declaration = "background-image:url("+ajax_image+") !important;background-repeat:no-repeat;background-position:3px 2px;";
			}else if(ajxloader=="css/flower.css"){
				ajax_image = "data:image/gif;base64,";
				declaration = "background-image:url("+ajax_image+") !important;background-repeat:no-repeat;";
			}else if(ajxloader=="css/kit.css"){
				ajax_image ="data:image/gif;base64,";
				declaration = "background-image:url("+ajax_image+") !important;background-repeat:no-repeat;";
			}else if(ajxloader=="css/roller.css"){
				ajax_image= "data:image/gif;base64,";
				declaration = "background-image:url("+ajax_image+") !important;background-repeat:no-repeat;";
			}else if(ajxloader=="css/snake.css"){
				ajax_image = "data:image/gif;base64,";
				declaration = "background-image:url("+ajax_image+") !important;background-repeat:no-repeat;";
			}else if(ajxloader=="css/wheel.css"){
				ajax_image = "data:image/gif;base64,";
				declaration = "background-image:url("+ajax_image+") !important;background-repeat:no-repeat;";
			}else if(ajxloader=="css/3drotation.css"){
				ajax_image ="data:image/gif;base64,";
				declaration = 'background-image:url('+ajax_image+') !important;background-repeat:no-repeat;';	
			}else if(ajxloader=="css/arrows.css"){
				ajax_image = "data:image/gif;base64,";
				declaration = "background-image:url("+ajax_image+") !important;background-repeat:no-repeat;";
		}else if(ajxloader == 'css/circleball1.css'){
				ajax_image = 'data:image/gif;base64,';
				declaration = 'background-image:url('+ajax_image+') !important;background-repeat:no-repeat;';	
			}else if(ajxloader == 'css/radar.css'){
				ajax_image = "data:image/gif;base64,";
				declaration = 'background-image:url('+ajax_image+') !important;background-repeat:no-repeat;';
			}else if(ajxloader == 'css/static.css'){
				ajax_image = "data:image/png;base64,";
				declaration = 'background-image:url('+ajax_image+') !important;background-repeat:no-repeat;';		
			}else if(ajxloader == 'css/refresh.css'){
				ajax_image = 'data:image/gif;base64,';
				declaration = 'background-image:url('+ajax_image+') !important;background-repeat:no-repeat;';		
			}
				
				// Ajax Loader - GIF Image
				declaration = "background-image:url("+ajax_image+") !important;background-repeat:no-repeat;background-position:2px 0px;top:-2px !important;"; 	 
				// CSS Node
				cssNode.innerHTML += selector+" {"+declaration+";}";
				cssNode.innerHTML += ".L4XNt{padding-left:25px;padding-right:3px;top:-2px !important;} ";
				// Gmail - CSS
				//if(gmail)		
				cssNode.innerHTML += "#viewer-details-toggle.details-loading, #loading-area .message-area-text-container, #loadingStatus, .vZ, .L4XNt, .J-J5-Ji,#sites-notice,#loadmessagehtml{ height:16px !important;top:-2px !important;} ";

				if(!(document.getElementById("loadmessagehtml") || document.getElementById("loadingStatus") || document.getElementById("loading-area-text")  || document.getElementById("lo") || document.getElementById("site-status") ) ){
					if(ajxloader=="css/google.css"){
						//cssNode.innerHTML += "#viewer-details-toggle.details-loading, #loading-area .message-area-text-container, #loadingStatus, .vZ, .L4XNt, .J-J5-Ji,#sites-notice,#loadmessagehtml{ height:17px !important;top:-2px !important;} ";		
						cssNode.innerHTML += ".L4XNt{background-position:2px -1px !important;} ";
					}
				}
				// Google Maps - CSS
				if(document.getElementById("loadmessagehtml")){
					cssNode.innerHTML +=" #loadmessagehtml{padding-left:17px !important;background-position:3px 2px; padding-bottom:4px;!important} ";		
				}	
				// Google Docs - CSS
				if(document.getElementById("loadingStatus")){
					cssNode.innerHTML +="#loadingStatus{background-position:5px 2px;padding-left:25px;width: auto !important;} "; 
					cssNode.innerHTML +=".message-area-text-container{ height:16px;padding-left:25px;padding-top:4px !important;padding-right:4px} ";
					if(ajxloader!="css/google.css"){
						cssNode.innerHTML +="#loadingStatus{background-position:5px 4px !important;padding-top:5px !important;} "; 
					}
					//		
				}				
				// Google Reader - CSS
				if(document.getElementById("loading-area-text")){ 
					document.getElementById("loading-area").style.width = "auto !important"; 
					cssNode.innerHTML +="#viewer-details-toggle.details-loading, #loading-area .message-area-text-container, #loadingStatus, .vZ, .L4XNt, .J-J5-Ji,#sites-notice,#loadmessagehtml{background-position:5px 2px;} .message-area-text-container { height:15px;} ";
					cssNode.innerHTML += " .message-area-text-container{padding-top:4px;padding-right:4px;padding-left:25px;}";	
					if((ajxloader=="css/google.css")){
						cssNode.innerHTML += "viewer-details-toggle.details-loading, #loading-area .message-area-text-container, #loadingStatus, .vZ, .L4XNt, .J-J5-Ji,#sites-notice,#loadmessagehtml{background-position: 5px 2px !important;} ";	
					}
				}
				// Google Calendar - CSS
				if(document.getElementById("lo")){
					if(ajxloader=="css/google.css")		
						cssNode.innerHTML +=" #lo{padding-left:17px !important;background-size: 12px;top:0px !important;background-position:2px 1px !important;} ";				
				}	
				// Google Sites - CSS
				if(document.getElementById("sites-status")){
					 cssNode.innerHTML +=" #sites-notice{padding-left:22px !important;background-position:3px 2px;} ";
					 document.getElementById("sites-notice").style.backgroundImage = "url("+ajax_image+") !important";
					 document.getElementById("sites-notice").style.backgroundRepeat = "no-repeat";
			 		 if(!(ajxloader=="css/google.css"))
			 				document.getElementById("sites-notice").style.backgroundColor = "#fff1a8 !important";													 
				}	
							
				// Add css node
				document.body.appendChild(cssNode);			
	}
}
//
safari.self.tab.dispatchMessage("getSettingValue", "ajaxloader"); // ask for value
safari.self.addEventListener("message", getMessage, false); // wait for reply